        const [boxs, setBoxs] = React.useState(props.on)
       
        const style = {
        backgroundColor: boxs ? "black" : "none"}
        
        function changeBox() {
        setBoxs(prevState => !prevState )}

    return (
            <p  styles={styles} onClick={changeBox} className='box'></p>
    )
}
